        fontSize: '50px',
        fondFamily: 'monotype corsiva'
    }
    return ( <
        >
        <
        h1 > MY imsais < /h1> <
        ul style = { sty } >
        <
        li > Tamil < /li> <
        li > manju < /li> <
        /ul> <
        Favfood / >

        <
        />



    )
}
export const Happy = () => {
    return ( <
        >
        <
        h1 > my happiness < /h1> <
        p > spent time with friends and family < /p> <
        p > Traveling alone < /p> <
        Favpic / >


        <
        />



    )
}
